"use strict";(self.webpackChunkwww=self.webpackChunkwww||[]).push([[477],{10:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"hello-world","metadata":{"permalink":"/blog/hello-world","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-01-17-hello-world.md","source":"@site/blog/2022-01-17-hello-world.md","title":"Hello World!","description":"Welcome to Dino-Might!! A sandbox that I am using to get familiar with the features and API provided by Docusaurus - a static site generator.","date":"2022-01-17T00:00:00.000Z","formattedDate":"January 17, 2022","tags":[{"label":"general","permalink":"/blog/tags/general"}],"readingTime":0.855,"truncated":false,"authors":[{"name":"Nitya Narasimhan","title":"Visual Storyteller | Cloud Advocate @MSFT","url":"https://github.com/nitya","imageURL":"https://github.com/nitya.png","key":"nitya"}]},"content":"Welcome to Dino-Might!! A sandbox that I am using to get familiar with the features and API provided by [Docusaurus](https://docusaurus.io/) - a static site generator.\\n\\nThe goal is to get to a template that I can repurpose for setting up project-specific blogs, documentation sites or portfolio pages. \\n\\n---\\n\\nSome things I want to explore:\\n\\n * `Scaffolding` = what does the boilerplate experience look like?\\n * `Deployment` = how easily can I deploy this to various hosting providers?\\n * `Tooling` = what dev tools exist for authoring, testing, CI/CD and auditing?\\n * `PWA` = how easily can I refactor this to be a progressive web app?\\n * `Testing` = how I do implement cross-browser testing and automation?\\n * `Authoring` = how do I use MDX and React support for richer UI/UX?\\n * `Modern` = how do I design for accessibility, localization, performance?\\n * `Integration` = does this play well with others (e.g., frameworks & services)\\n\\nI\'ll be overhauling the [Tutorials](/docs/intro) section to document my learnings as I go.\\n\\n---\\n\\nLet\'s Go Docu-venturing!"}]}')}}]);